import React, { Component } from "react";

import PlaneModel from "./PlaneModel";

function PlaneModelList(props) {
    return (
        <ul>
        {props.planeModels.map(pm => <PlaneModel key={pm.name} name={pm.name}/>)}
        </ul>
    );
}

export default PlaneModelList;
